import React from 'react'
import {Switch, Route} from 'react-router-dom'

import Cart from '.'
import Home from './pages/Home/index'
export default function Routes(){
  return(
      <Switch>
        <Route path="/" exact component={Home}/>
        <Route path="/cart" component={Cart}/>

      </Switch>


  );




}
